🆘️갈곳없는 아이🆘️ 🙏리그램 해주세요🙏
샤페이 8킬로 여아 나이 1~2세 추정
이리저리 알아보니 여기서 더 자라지 않는
작은 종에 속한다고 합니다
.
도데체 언제 버려진건지 얼마나 떠돌고 다닌건지 발바닥이며 발톱은 이미 파고들어 
엉망이고 눈은 이미 찔린지 오래된거 같아
빨리 쌍커플을 안해주면 아이는 머잖아 
실명이 될거라고 합니다
.
🚫🚫개장수에게 넘길지 시보호소에 넘길지
🚫🚫잠시 밥 얻어먹고 쉬어가려 자리잡은 집
주인은 이 두가지만 고민중입니다🚫🚫
.
🔥🔥 시골구석에 어느날 갑자기 나타나
어디로 갈지 몰라서 였을까요? 아님 더 이상
헤메고 다닐 기력조차 남지 않았던 걸까요
.
😭아이는 혹시 몰라 목줄을 착용시켜 남의집
마당한켠에 머물고 있지만 그조차 며칠안에
떠나야 합니다  생전 첨보는 사람의 손길도
피하지 않고 목줄 착용중에도 얌전히 있고
다른 개들에게 경계심이나 거부감도 없이
오히려 무서워 숨고 피한다고 합니다
.
시보호로 가면 번식업자들의 먹잇감이 되거나
아니면 안락사 명단에 오르겠죠
🤬개장수에게 팔려가면......
이러나 저러나 이 아이에겐 죽음 이라는 것을
피해갈수 있는 돌파구가 없습니다 
.
독립성이 강할뿐 샤페이 종 중에서도 사나움과
거리가 먼 아이 입니다  그냥 가만히 두고 
산책시켜주고 밥주고 그리고 마음으로 
품어주면 되는 아이입니다 
.
🆘️🆘️이 아이 살릴수 없을까요??
아이 가족이 되어주실분 안계시나요??
치료비가 부담이시라면  어떻게해서라도
보태어 드릴께요 모금이든 뭐든 약속할께요
.
제발 아이  살아서  사랑받으며 살수있게
가슴으로 품어주세요☎️ 010 9643 9573
24시간 언제든 연락주세요
.
